    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% form_theme registrationForm _self %}{# Creating our Theme! #}

{% block title %}Register!{% endblock %}
{% block stylesheets %}
    {{ parent() }} {# get three designs on base.twig #}

    <link rel=\"stylesheet\" href=\"{{ asset('css/login.css') }}\">{# a ovde uzimam samo iz login.css #}
{% endblock %}

{# Creating our Theme! This code is copied from from_div_layout #}
{% block form_row %}
    {%- set widget_attr = {} -%}
    {%- if help is not empty -%}
        {%- set widget_attr = {attr: {'aria-describedby': id ~\"_help\"}} -%}
    {%- endif -%}

    {{- form_label(form, null, {
        label_attr: { class: 'sr-only' }
    }) -}}
    {{- form_errors(form) -}}
    {{- form_widget(form, widget_attr) -}}
    {{- form_help(form) -}}

{% endblock %}

{# Form theming a single Field #}
{% block _user_registration_form_agreeTerms_row %}
    <div class=\"checkbox mb-3\">
        {{ form_errors(form) }}
        <label>
            <input type=\"checkbox\" name=\"{{ full_name }}\"> Agree to terms I for sure read
        </label>
    </div>
{% endblock %}

{% block body %}

    {{ form_start(registrationForm, {
        attr: {class: 'form-signin'}
    }) }}
    <h1 class=\"h3 mb-3 font-weight-normal\">Register</h1>

    {# {{ form_widget(registrationForm) }} #}
    {{ form_row(registrationForm.email, {
        attr: {placeholder: 'Email'}
    }) }}
    {{ form_row(registrationForm.plainPassword, {
        attr: {placeholder: 'Password'}
    }) }}
    {{ form_row(registrationForm.agreeTerms) }}

    <button class=\"btn btn-lg btn-primary btn-block\" type=\"submit\">
        Register
    </button>
    {{ form_end(registrationForm) }}

    {# <form class=\"form-signin\" method=\"post\">



    <h1 class=\"h3 mb-3 font-weight-normal\">Register</h1>
    <label for=\"inputEmail\" class=\"sr-only\">Email address</label>
    <input type=\"email\" name=\"email\" id=\"inputEmail\" class=\"form-control\" placeholder=\"Email address\" required autofocus>
    <label for=\"inputPassword\" class=\"sr-only\">Password</label>
    <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" placeholder=\"Password\" required>

    <input type=\"hidden\" name=\"_csrf_token\"
           value=\"{{ csrf_token('authenticate') }}\"
    >

    <div class=\"checkbox mb-3\">
        <label>
            <input type=\"checkbox\" name=\"_terms\"> Agree to terms I for sure read
        </label>
    </div>
    <button class=\"btn btn-lg btn-primary btn-block\" type=\"submit\">
        Register
    </button>
    </form> #}
{% endblock %}
